    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + 85 / col0 * col0 * + col1 / col2 <> - + 38 + + - col1 * 33;
  - name: tab2

outputs:
  - name: q320.out
    data: |
      46	51	23
      64	77	40
      75	67	58
